import React from 'react';
import Link from 'next/link';

import { Reac  }  from '../assets/provisional-logo.svg';



function TopNav(props) {
  return (
    <div className='top-nav'>
      <Link href='/'>
        <a>
          <h1>
            THE<br></br>SHADZ
          </h1>
        </a>
      </Link>
      <span className='top-nav__items'>TOP NAV ITEMS</span>
    </div>
  );
}

export default TopNav;
